measurements.description:
Three flat, well-proportioned flowers on two inflorescences; dorsal sepal green-yellow, heavily overlaid fuschia centrally, heavily overlaid magenta distally;
    lateral sepals green-yellow, superior halves overlaid magenta basally, inferior halves heavily overlaid magenta; petals green-yellow, concentrically barred magenta basally;
    lip white, overlaid fuschia, side lobes yellow; column fuchsia, anther cap fuchsia; substance hard; texture waxy.
    substance hard; texture waxy.
